function getIdentifier(str) {
  return str.slice(26, 41); // from index 13, length 10
}

// Step 1: Group matching identifiers and their strings
const idMap = new Map();
const combined = [...report_old, ...newMdeReport];

for (const str of combined) {
  const id = getIdentifier(str);
  if (!idMap.has(id)) {
    idMap.set(id, []);
  }
  idMap.get(id).push(str);
}

// Step 2: Only keep ids with 2 strings (one from each array)
const result = [];

for (const [id, data] of idMap.entries()) {
  if (data.length === 2) {
    const [str1, str2] = data;
    const differences = [];

    // Step 3: Compare char-by-char
    for (let i = 0; i < Math.max(str1.length, str2.length); i++) {
      if (str1[i] !== str2[i]) {
        differences.push({
          position: i +1,
          value1: str1[i] || null,
          value2: str2[i] || null,
        });
      }
    }

    result.push({
      id,
      data: [str1, str2],
      differences,
    });
  }
}

const fs = require("fs");

function generateReport(data) {
  let report = "";

  data.forEach((entry) => {
    report += `ID: ${entry.id}\n`;
    report += `String 1: ${entry.data[0]}\n`;
    report += `String 2: ${entry.data[1]}\n`;
    report += `Differences:\n`;

    if (entry.differences.length === 0) {
      report += "  No differences found.\n";
    } else {
      entry.differences.forEach((diff) => {
        report += `  Position ${diff.position}: '${diff.value1}' vs '${diff.value2}'\n`;
      });
    }

    report += `\n-----------------------------\n\n`;
  });

  return report;
}

function downloadAsTextFile(filename, textContent) {
  fs.writeFile(filename, textContent, (err) => {
    if (err) {
      console.error("Error writing file:", err);
    } else {
      console.log(`Report saved as ${filename}`);
    }
  });
}

// Generate the report content
const reportText = generateReport(result);

// Save the report to a file
downloadAsTextFile("compaire_mde-report.txt", reportText);
